import './Home.css'


export default class Home extends Component{
	render(){
		return(
				<div className='Home'> 
					  <div className="hero-image">
					  <img src="../public/images/me.jpg" alt='me' className='ted-face'/>
				          <div className="hero-text">
				            <h1>Hi, I'm Teddy</h1>
				            <p>My passions include coding, coffee, and cats </p>
				          </div>
				      </div>
				</div>
			)
	}
}
